import './App.css';
import PicComponent from './PicComponent';
import Login from './Login'

const App = () => {
  return (

    <div className="row">
      <div className="col-8 bg-blue h-auto">
        <PicComponent />
      </div>
      <div className="col-4 bg-silver">
        <Login />
      </div>
    </div>

  );
}

export default App;
